function Navbar(){
    return (
        <nav className="navbar">
            <h1>Control Cognizant</h1>
            <div className="links">
                <a href="https://nist.gov">NIST\n</a>
                <a href="https://hitrustalliance.net/">HITRUST</a>
            </div>
        </nav>
    );
}
export default Navbar;
